import styled from 'styled-components'

const StyledBurger = styled.div`
    margin-left: auto;
    margin-right: 50px;
    width: 2rem;
    height: 2rem;
    postion; fixed;
    top: 15px;
    right: 20px;
    display: flex;
    justify-content: space-around;
    flex-flow: column nowrap;
    
    div{
        width: 2rem;
        height: 0.1rem;
        background-color: white;
        border-radius: 10px;
    }
`


const Burger = () => {
    return ( 
        <StyledBurger>
            <div></div>
            <div></div>
            <div></div>
        </StyledBurger>
    );
}
 
export default Burger;
